import React,{Component} from 'react'; 
import Afternav from "../Coponent/nav_after";

class Profile extends Component {
    constructor(){
        super();
        this.state = {
            l:[]
        }
    }
    handleSubmit1= (event) =>{
        const d=this.props.user
        console.log(d)
        this.setState({
            l:d
        })
    }
    
    render() {
        const {l}=this.state
        
        return (
            <div className="room">
                <Afternav />  
                <div className="allPro">
                    <button onClick={()=>this.handleSubmit1()}>Your profile</button> 
                </div>
            </div>
        );
    }
}
export default Profile;
